import React from "react";

export const BigCard = props => {
  const item = props.item;
  return item !== null ? (
    <div>
      <h1>{item.name}</h1>
      <h2>{item.username}</h2>
      <h2>{item.email}</h2>
    </div>
  ) : (
    <h1>Select a person</h1>
  );
};
